sources.components/models/models.scss:
.models {
  &__content {
    padding: 60px 0 70px;
  }
  &__list {
    display: flex;
    flex-wrap: wrap;
    margin-top: -30px;
    margin-left: -15px;
    margin-right: -15px;
    margin-bottom: 60px;
  }
  &__item {
    width: calc(100% / 4 - (120px / 4));
    margin-top: 30px;
    margin-left: 15px;
    margin-right: 15px;
    & > * {
      height: 100%;
    }
  }
  &__tech {
    width: 100%;
    &-title {
      margin-bottom: 30px;
      font-size: 26px;
    }
    &-scroll {
      display: none;
      margin-top: 25px;
    }
  }
}

@keyframes pseudoScroll {
  0% {
    opacity: 0;
    left: 30px;
  }
  50% {
    opacity: 1;
    left: 60px;
  }
  100% {
    opacity: 0;
    left: 90px;
  }
}

.pseudo-scroll {
  position: relative;
  padding: 0 25px;

  &__line,
  &__line-active {
    height: 4px;
    border-radius: 3px;
  }
  &__line {
    position: relative;
    background-color: #dde3eb;
    &-active {
      position: absolute;
      top: 0;
      left: 30px;
      width: 70px;
      background-color: $active;
      animation-name: pseudoScroll;
      animation-duration: 1.5s;
      animation-timing-function: ease-in-out;
      animation-iteration-count: infinite;
      animation-fill-mode: forwards;
    }
  }
  &__arrow {
    & svg {
      position: absolute;
      top: 50%;
      fill: #b2bdcc;
    }

    &.--prev svg {
      left: 0;
      transform: translateY(-50%) rotate(180deg);
    }
    &.--next svg {
      right: 0;
      transform: translateY(-50%);
    }
  }
}

@media (max-width: 1366px) {
	.models {
    &__item {
      width: calc(100% / 3 - (120px / 4));
    }
    &__tech {
      overflow-x: scroll;

      &-scroll {
        display: block;
      }
    }
  }
}

@media (max-width: 992px) {
	.models {
    &__item {
      width: calc(100% / 2 - (120px / 4));
    }
	}
}

@media (max-width: 767px) {
	.models {
    &__list,
    &__item {
      margin-left: 0;
      margin-right: 0;
    }
    &__list {
      align-items: center;
      flex-direction: column;
    }
