        max-width: 100%;
        transition: border-color $transition, background-color $transition;
        &:not(.form__checkbox) {
            & + & {
                margin-top: 18px;
            }
        }
        & + .form__select {
            margin-top: 18px;
        }
        &.--warn {
            & .form__warn {
