                    opacity: 1;
                }
            }
            &.--search {
                background-color: #fff;
            }
        }
        &.--error {
            border-color: $error;
        }
        &.--phone {
            & .form__input {
                opacity: 0;
                transition: opacity $transition;
            }
        }
        &.--search {
            border-right: unset;
            border-top-right-radius: unset;
            border-bottom-right-radius: unset;
            border-top: 1px solid transparent;
            border-left: 1px solid transparent;
            border-bottom: 1px solid transparent;
            background-color: transparent;
            & .form__input {
                height: 34px;
                padding: 12px 142px 12px 20px;
                @media (max-width: $tablet) {
                    padding-right: 120px;
                }
            }
            & .form__placeholder {
                top: 5px;
            }
        }
        &.--cities {
            display: flex;
            & [name="search"] {
                border: 1px solid $bg_gray;
            }
            & .form__search {
                height: 38px;
                padding-right: 115px;
                border: 1px solid $bg_gray;
            }
            & .form__placeholder {
                top: 5px;
            }
            & .form__label-close {
                right: 77px;
            }
            & .form__button {
                cursor: pointer;
                position: relative;
                width: 60px;
                min-width: 60px;
                padding: 0;
                border-top: 1px solid $bg_gray;
                border-right: 1px solid $bg_gray;
                border-bottom: 1px solid $bg_gray;
                &:hover {
                    & .form__button-icon {
                        fill: $activeOrange;
                    }
                }
                &-icon {
                    @extend %absoluteCenter;
                    transition: fill $transition;
                }
            }
        }
        &-close {
            position: absolute;
            top: 50%;
            right: 100px;
            transform: translateY(-50%);
