        padding: 11px 20px;
    }
    &__placeholder {
        position: absolute;
        top: 10px;
        left: 20px;
        color: $text_placeholder;
        transition: opacity $transition;
        cursor: text;
    }
    &__warn {
        position: absolute;
        left: 0;
        bottom: -2px;
        color: $error;
        opacity: 0;
