            & .form__select-list {
                opacity: 1;
                transform: none;
                pointer-events: unset;
                max-width: 375px;
                border-radius: 0px 0px 7px 6px;

                max-height: 247px;
                // overflow: hidden;
                // overflow-y: hidden;
                // overflow-y: scroll;
            }
