    }
    &__nav-tabs {
        position: relative;
        @media (max-width: $tablet) {
            overflow-x: scroll;
            height: 50px;
        }
        &::after {
            position: absolute;
            top: 45px;
            left: 0px;
            content: "";
            width: 100%;
            height: 1px;
            background-color: #e0e0e7;
            @media (max-width: $tablet) {
                display: none;
            }
        }
    }
    &__title-item {
        margin: 15px 0px 10px;
