        position: relative;
        &:last-child {
            margin-right: 0px;
        }
        &::after {
            transition: $transition;
            background-color: $btn-blue;
            position: absolute;
            content: "";
            bottom: -25px;
            left: 0;
            z-index: 1;
            width: 100%;
            height: 2px;
            opacity: 0;
            // transform: translateX(-95px);
        }
        &.active {
            transition: $transition;
            color: $black;
            &::after {
                // transform: translateX(0px);
                opacity: 1;
            }
        }
        &:hover {
            color: $black;
        }
    }
    &__tab-pane {
        width: 100%;
        display: none;
        padding-top: 35px;
        @media (max-width: $phone) {
            padding-top: 0;
        }
